    func runFullTestWith(_ audiograms: [[Double]], accuracy: Double = 0.1, frequencies: [Double] = [250,500,1000,2000,4000,8000]) throws {
        let waitIteractions = 1000
        
        for audiogram in audiograms {
            let maxLevel = 75.0
            let minLevel = -10.0
            let newAudiometry = ORKNewAudiometry(channel: .left, initialLevel: 45, minLevel: minLevel, maxLevel: maxLevel, frequencies: frequencies)
                        
            while newAudiometry.testEnded == false {
                // Try waiting for nextStimulus
                var optionalStimulus: ORKAudiometryStimulus?
                for _ in 0..<waitIteractions {
                    optionalStimulus = newAudiometry.nextStimulus()
                    if (optionalStimulus == nil) {
                        Thread.sleep(forTimeInterval: 1/Double(waitIteractions))
                    } else {
                        break
                    }
                }
                
                // If we got an stimulus, register the response
                if let stimulus = optionalStimulus {
                    // interpolate between audiogram points
                    let freqHL = newAudiometry.bark(frequencies.asVector())
                    let freqs = vDSP.linearInterpolate(values: [freqHL.minimum(),freqHL.maximum()], atIndices: [0,999])
                    let levels = Interpolators.interpCs(x: freqs, xp: freqHL.elements, fp: audiogram)

                    let freqPoint = newAudiometry.bark(stimulus.frequency)
                    let testLevel = levels[newAudiometry.findNearest(freqs.asVector(), freqPoint)]
                    
                    newAudiometry.registerStimulusPlayback()
                    if stimulus.level > testLevel {
                        newAudiometry.registerResponse(true)
                    } else {
                        newAudiometry.registerResponse(false)
                    }
                }
            }
            
            let res = newAudiometry.resultSamples()
            let filteredRes = frequencies.compactMap { freq in
                res.first { $0.frequency == freq }
            }
            
//            Debug logs
//            let onLimits = audiogram.allSatisfy { $0 <= maxLevel && $0 >= minLevel }
//            print("\nFinished with \(newAudiometry.ySample.shape.rows) trials")
//            print("Freqs:  \(filteredRes.map { String(fromFrequency: $0.frequency) })")
//            print("Input:  \(audiogram.map { String(fromThreshold: $0) } ) \(onLimits ? "" : "Contains thresholds out of limits")")
//            print("Output: \(filteredRes.map { String(fromThreshold: $0.calculatedThreshold) }) \(onLimits ? "" : "Results clipped to limits")")
//
//            let deltas = zip(audiogram, filteredRes.map { $0.calculatedThreshold }).map { $1 - $0 }
//            let maxMag = String(format: "%.4lf", deltas.map { abs($0) }.max() ?? 0.0)
//            let avgMag = String(format: "%.4lf", deltas.map { abs($0) }.reduce(0, +) / Double(deltas.count))
//            print("Deltas: \(deltas.map { String(fromThreshold: $0) }) Max: \(maxMag)  Avg: \(avgMag)")
            
            if (!newAudiometry.initialSampleEnded && newAudiometry.testEnded) {
                // Check if the test was stopped after all positive or negative responses on the initial sampling
                XCTAssertEqual(res.count, 0)

                let allUpperLimit = audiogram.allSatisfy { $0 >= maxLevel }
                let allLowerLimit = audiogram.allSatisfy { $0 <= minLevel }
                XCTAssertEqual((allUpperLimit || allLowerLimit), true)
            } else {
                // Check the results of a valid test
                XCTAssertEqual(filteredRes.count, audiogram.count)
                for (value1, value2) in zip(filteredRes, audiogram) {
                    var clippedValue2 = min(maxLevel, value2)
                    clippedValue2 = max(minLevel, clippedValue2)
                    
                    XCTAssertEqual(value1.calculatedThreshold, clippedValue2, accuracy: accuracy, "calculatedThreshold does not match expected level for frequency: \(value1.frequency) With error: \(value1.calculatedThreshold - clippedValue2)\n Expected: \(audiogram.map { String(format: "%.2f", $0) })\n Result:   \(res.map { String(format: "%.2f", $0.calculatedThreshold) })\n")
                }
            }
        }
    }
